export default (menu=[])=>{
	//一级标题加图标
	const iconArr = ['el-icon-document','el-icon-mobile-phone','el-icon-setting'];
	const pathArr = {
		'04df476535964b00b526b82500c29e':'proTotal', //项目总览
		'123212232323213123131':'index', //项目展示页

		'9c33285892b942338bdc69b9cf7446':'testManage', //测试管理
		'123456765432123456543222222222':'testStatus', //任务状态

		'ba82b0d35e7744ec909db35709e893':'test', //测试
		'53f7c10631d14efb8f1b16b8771153':'compatible', //兼容
		'676591af0c014422af46ef0ed23f4d':'effect', //功能
		'0335db0cc0b24d1da0c8140ffb8ee2':'performance', //性能
	}
	for(let i = 0; i<menu.length;i++){
		let item = menu[i];
		item.icon = iconArr[i];
		item.index = 'views';
		item.secCatalogs.forEach(item=>{
			item.index = pathArr[item.id];  
		})

	}
	return menu
}
